These are the logical steps of the resolver, although they are more interleaved than this initial summary implies: Build data structures Construct the DepGraph Construct the CriteriaMapper Determine the required criteria for each package Apply requirements for dev-dependencies Propagate policy requirements from roots out to leaves Resolve the validated criteria for each third party (crates.io) package Construct the AuditGraphs for each package (and check violations) Search for paths in the audit graph validating each requirement Check if each crate validates for the required criteria Record caveats which were required in order to satisfy these criteria Suggest audits to fix leaf failures (the dance of a thousand diffs) Here in all of its glory is the entirety of the resolver algorithm today in abbreviated pseudo-rust. Each of these steps will be elaborated on in the subsequent sections. // Step 1a: Build the DepGraph
let graph = DepGraph::new(..);
// Step 1b: Build the CriteriaMapper
let mapper = CriteriaMapper::new(..); // Step 2: Determine the required criteria for each package
let requirements = resolve_requirements(..); // Step 3: Resolve the validated criteria for each third-party package
for package in &graph.nodes { if !package.is_third_party { continue; } // Step 3a: Construct the AuditGraph for each package let audit_graph = AuditGraph::build(..); // Step 3b: Search for paths in the audit graph validating each requirement let search_results = all_criteria.map(|criteria| audit_graph.search(criteria, ..)); // Step 4: Check if the crate validates for the required criteria for criteria in requirements[package] { match &search_results[criteria] { .. } }
} // If there were any conflicts with violation entries, bail!
if !violations.is_empty() { return ResolveReport { conclusion: Conclusion::FailForViolationConflict(..), .. };
} // If there were no failures, we're done!
if failures.is_empty() { return ResolveReport { conclusion: Conclusion::Success(..), .. };
} // Step 5: Suggest time! Compute the simplest audits to fix the failures!
let suggest = compute_suggest(..); return ResolveReport { conclusion: Conclusion::FailForVet(..), .. }; As we determine the required criteria in an separate pass, all analysis after that point can be performed in any order. Requirements analysis starts on root nodes and is propagated downwards to leaf nodes.

